      <style>
        @font-face {
            font-family: Inter; 
            src: url("./fonts/Inter-Bold.otf") format("opentype");
        }

        @font-face {
            font-family: SF Pro Display-300;
            src: url("./fonts/SF-Pro-Display-Light.otf") format('opentype');
        }

        @font-face {
            font-family: SF Pro Display-400;
            src: url("./fonts/SFPRODISPLAYREGULAR.OTF") format('opentype');
        }

        @font-face {
            font-family: SF Pro Display-600;
            src: url("./fonts/SF-Pro-Display-Semibold.otf") format('opentype');
        }

        .timeIt {
            fill: #FFF;
            font-family: Inter;
            font-size: 14px;
            letter-spacing: -0.28px; 
        }

        .transferMoney {
            fill: #FFF;
            font-family: SF Pro Display-600;
            font-size: 22px;
            letter-spacing: 0.33px;
        }

        .receiveAccout {
            fill: #3B3B3B;
            font-family: SF Pro Display-300;
            font-size: 17px;
            letter-spacing: 0.17px;
        }
        
        .receiveUser {
            fill: #D27835;
            font-family: SF Pro Display-400;
            font-size: 17px;
            letter-spacing: 0.085px;
        }

        .tradingCode {
            fill: #3B3B3B;
            font-family: SF Pro Display-300;
            font-size: 17px;
            letter-spacing: 0.17px;
        }

        .receiveBank {
            fill: #3B3B3B;
            font-family: SF Pro Display-300;
            font-size: 17px;
            letter-spacing: 0.17px;
        }

        .fee {
            fill: #3B3B3B;
            font-family: SF Pro Display-300;
            font-size: 17px;
            letter-spacing: 0.17px;
        }

        .tradingTime {
            fill: #3B3B3B;
            font-family: SF Pro Display-300;
            font-size: 17px;
            letter-spacing: 0.17px;
        }
        
        .tradingDate {
            fill: #3B3B3B;
            font-family: SF Pro Display-300;
            font-size: 17px;
            letter-spacing: 0.17px;
        }

    </style>

    <text x="30.5" y="28.9" text-anchor="start" class="timeIt">
       ${timeIt} 
    </text>

    <text x="0" y="307" class="transferMoney" text-anchor="start">
        <tspan dx="36">
            ${transferMoney}
        </tspan>
        <tspan dx="0">
            ${"VND"}
        </tspan>
    </text>

    <text x="0" y="380" class="receiveAccout" text-anchor="start">
        <tspan dx="30"> 
            ${receiveAccout}
        </tspan>
    </text>

    <text x="0" y="451" text-anchor="start" class="receiveUser">
        <tspan dx="30"> 
            ${receiveUser}
        </tspan>
    </text>

    <text x="0" y="520" class="tradingCode" text-anchor="start">
        <tspan dx="30"> 
            ${tradingCode}
        </tspan>
    </text>

    <text x="0" y="590.5" text-anchor="start" class="receiveBank">
        <tspan dx="30">${receiveBank}</tspan>        
    </text>

    <text x="0" y="659" text-anchor="start" class="fee">
       <tspan dx="30">${fee}</tspan>  
       <tspan dx="0">${"VND"}</tspan>  
    </text>

    <text x="0" y="731" text-anchor="start" class="tradingTime">
       <tspan dx="30">${tradingTime}</tspan>  
    </text>

    <text x="0" y="731" text-anchor="start" class="tradingDate">
       <tspan dx="75.5">${tradingDate}</tspan>  
    </text>
    ${rightStatusBar}

</svg> `;
